import { GET_INGREDIENTS } from "../IngredientActions/Types";

const initialState = {
  ingredients: [],
  ingredient: {},
};

export default function (state = initialState, action) {
  switch (action.type) {
    case GET_INGREDIENTS:
      return {
        ...state,
        ingredients: action.payload,
      };
    default:
  }
}
